	add("shochu", "{\"term\":\"shochu\", \"etymology\":{\"influencers\":[], \"languages\":[\"mandarin chinese\", \"English\", \"Japanese\", \"Korean\", \"late middle chinese\"], \"text\":\"From Japanese 焼酎 (\u0027shōchū\u0027 しょうちゅう), from Late middle chinese 燒酒 (\u0027ʃew-t͡sjúw\u0027 \u0026quot;liquor\u0026quot;) (compare Mandarin chinese \u0027shāojiǔ\u0027 烧酒, Korean \u0027soju\u0027 소주), from 燒 (\u0026quot;burn\u0026quot;, \u0026quot;flammable\u0026quot;) + 酒 (\u0026quot;alcohol\u0026quot;).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Japanese alcoholic beverage, most commonly distilled from barley, sweet potato or rice. Typically it is 25% alcohol by volume, making it weaker than whisky, but stronger than wine and sake\", \"priority\":1}]}, \"synonyms\":{}}");

