	add("shoegaze", "{\"term\":\"shoegaze\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|shoe|gaze|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Shoegazing, an introspective genre of alternative rock popular in the 1990s which made extensive use of guitar effects\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Courtney E. Smith, \u0027Record Collecting for Girls: Unleashing Your Inner Music Nerd, One Album at a Time\u0027, [http://books.google.com.au/books?id\u003dd2oYMtNMUlQC\u0026amp;pg\u003dPA144\u0026amp;dq\u003d%22shoegaze%22%7C%22shoegazes%22%7C%22shoegazed%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dxNlwU-mEEsLFkgXF2IHADg\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22shoegaze%22%7C%22shoegazes%22%7C%22shoegazed%22\u0026amp;f\u003dfalse page 144\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Historically, it is filed by music critics under the \u0027\u0027shoegaze\u0027\u0027 genre. I suppose this is because the band used a lot of the same guitar tones as \u0027\u0027shoegaze\u0027\u0027 outfits from the same time, but it was really a bit too psychedelic to fit the genre\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Benjamin Halligan, \u00273: \u0027\u0027Shoegaze\u0027\u0027 as the Third Wave: Affective Psychedelic Noise, 1965-91\u0027, Michael Goddard, Benjamin Halligan, Nicola Spelman (editors), \u0027Resonances: Noise and Contemporary Music\u0027, [http://books.google.com.au/books?id\u003d1T0bAAAAQBAJ\u0026amp;pg\u003dPA58\u0026amp;dq\u003d%22shoegaze%22%7C%22shoegazes%22%7C%22shoegazed%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dxNlwU-mEEsLFkgXF2IHADg\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22shoegaze%22%7C%22shoegazes%22%7C%22shoegazed%22\u0026amp;f\u003dfalse page 58\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Most of the releases from the Boo Radleys during their \u0027\u0027shoegaze\u0027\u0027 phase feature just such a baroque, as do \u0027Killing Time\u0027 by Bleach (1992; with a prawn) and \u0027... x, y and z\u0027 by Moose (1992; with a sunflower).In the same way that the image of the sheep is common for EDM releases at this time, the cat comes to typify \u0027\u0027shoegaze\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Alex Niven, \u0027Oasis\u0027 Definitely Maybe\u0027, [http://books.google.com.au/books?id\u003d7yw_AwAAQBAJ\u0026amp;pg\u003dPA44\u0026amp;dq\u003d%22shoegaze%22%7C%22shoegazes%22%7C%22shoegazed%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dxNlwU-mEEsLFkgXF2IHADg\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22shoegaze%22%7C%22shoegazes%22%7C%22shoegazed%22\u0026amp;f\u003dfalse page 44\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027shoegaze\u0027\u0027 influence in the early Oasis sound is just as pronounced as the debt to the grunge of \u0027Nevermind\u0027. Although they were viewed as something of an anomaly within the \u0027\u0027shoegaze\u0027\u0027 label Creation, Oasis were nevertheless a neo-psychedelic rock band with a taste for distorted guitars and classic sixties pop, so in fact they fitted in pretty well with the Creation house style\", \"priority\":10}]}, \"synonyms\":{}}");

	add("shoegazing", "{\"term\":\"shoegazing\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|shoe|gazing|lang\u003den}}, because of the tendency of such performers to look down rather than at the crowd.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of Britpop or other indie music of the 1990s, characterised by a dreamlike sound making much use of effect pedals, and by a detached or introverted performance style\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, James Buckley, \u0027Celebrate Myself\u0027, [http://books.google.com.au/books?id\u003dfbJt-4mncQ8C\u0026amp;pg\u003dPA12\u0026amp;dq\u003d%22shoegazing%22%7C%22shoegazings%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dzbxwU97BEIWekwXXooEY\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22shoegazing%22%7C%22shoegazings%22\u0026amp;f\u003dfalse page 12\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"quot;Anyway, correct me if I\u0027m wrong here, Danny, but wasn\u0027t it you who told me that true \u0027\u0027shoegazing\u0027\u0027 began and ended with Slowdive\u0027s 12-inch debut: the imaginatively titled, \u0027Slowdive\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"“You\u0027re taking me out of context here, dude. What I meant was that it was the epoch of the genre. The other bands still made a valid contribution, they just didn\u0027t define the moment.\u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Barney Hoskyns, \u0027Lowside of the Road: A Life of Tom Waits\u0027, [http://books.google.com.au/books?id\u003dQ_DOvgMH-KgC\u0026amp;pg\u003dPA491\u0026amp;dq\u003d%22shoegazing%22%7C%22shoegazings%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dzbxwU97BEIWekwXXooEY\u0026amp;redir_esc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22shoegazing%22%7C%22shoegazings%22\u0026amp;f\u003dfalse page 491\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Johansson and Sitek started out in more faithful lo-fi style before filtering the songs through an indie-rock sensibility that\u0027s equal parts postpunk-gothic, 4AD dreampop, \u0027\u0027shoegazing\u0027\u0027 drone, and TV on the Radio epicness\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Pete Crigler, \u0027Majorlabelland And Assorted Oddities\u0027, [http://books.google.com.au/books?id\u003dcZcGAQAAQBAJ\u0026amp;pg\u003dPA91\u0026amp;dq\u003d%22shoegazing%22%7C%22shoegazings%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dzbxwU97BEIWekwXXooEY\u0026amp;redir_esc\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22shoegazing%22%7C%22shoegazings%22\u0026amp;f\u003dfalse page 91\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Then in 2003, they released \u0027Still Electric\u0027 only on their website; with this album, they\u0027d taken on more of a \u0027\u0027shoegazing\u0027\u0027 style of rock, similar to Chapterhouse or Catherine Wheel\", \"priority\":11}]}, \"synonyms\":{}}");

