	add("shofar", "{\"term\":\"shofar\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Hebrew\"], \"text\":\"From the Hebrew \u0027שׁוֹפָר|tr\u003dshofár\u0027 (shofar)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"File:Jemenittisk sjofar av thum\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A ram’s-horn trumpe\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, Anthony Burgess, \u0027Kingdom of the Wicked\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Thaddeus the fluteplayer had, it seems, found a ram’s horn or \u0027\u0027shofar\u0027\u0027, and he was blowing this not in the normal manner of an angry summons but so as to produce a melody of four notes, like a camp call to dinner or parade\", \"priority\":4}]}, \"synonyms\":{}}");

