	add("shogun", "{\"term\":\"shogun\", \"etymology\":{\"influencers\":[], \"languages\":[\"mandarin chinese\", \"English\", \"Japanese\", \"late middle chinese\"], \"text\":\"From Japanese \u0027lang\u003dja\u0027 from an abbreviation of \u0027lang\u003dja\u0027 which means \u0026quot;General who overcomes the barbarians\u0026quot;, from Late middle chinese 將軍 (\u0027tsjàng-kjun\u0027 \u0026quot;leader of troops\u0026quot;, \u0026quot;general\u0026quot;) (compare Mandarin chinese \u0027jiàngjūn\u0027 将军).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The supreme generalissimo of feudal Japan\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The third is the\u0027 \u0027\u0027Shogun\u0027\u0027 \u0027who reygneth at the preſent , and hath rayſed the perſecution ( whereof this booke intreateth ) againſt the Chriſtians , and he as it ſeemeth is acknowledged as Lord of all the threeſcore and ſix Kingdomes of\u0027 Iaponia\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1619\u0027\u0027: W. W. Gent (tr.), \u0027A briefe relation of the persecution lately made against the Catholike christians, in the Kingdome of Iaponia, devided into two books\", \"priority\":3}]}, \"synonyms\":{}}");

