	add("shooter", "{\"term\":\"shooter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|shoot|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who shoots something; a gunner, archer etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A firearm\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A video game in which shooting enemies (or targets) is the main objective\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A professional wrestler who uses actual fighting moves as part of his style, or who speaks his mind during a live or televised event (instead of speaking from a script\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A large marble used for knocking smaller marbles out of a chalk circle\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Jamie MacLennan, ZhaoHui Tang, Bogdan Crivat, \u0027Data Mining with Microsoft SQL Server 2008\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"You separate the marbles by color until you have four groups, but then you notice that some of the marbles are regulars, some are \u0027\u0027shooters\u0027\u0027, and some are peewees\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An alcoholic beverage typically served in a shot glass\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A shooting star.\u0026lt;!--Webster 1913--\u0026gt\", \"priority\":9}]}, \"synonyms\":{}}");

