	add("shortage", "{\"term\":\"shortage\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|short|age|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A lack or deficiency; an insufficient amount\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/leaders/21582516-worlds-thirst-oil-could-be-nearing-peak-bad-news-producers-excellent Yesterday’s passage\u003dThe dawn of the oil age was fairly recent. Although the stuff was used to waterproof boats in the Middle East 6,000 years ago, extracting it in earnest began only in 1859 after an oil strike in Pennsylvania.It was used to make kerosene, the main fuel for artificial lighting after overfishing led to a \u0027\u0027shortage\u0027\u0027 of whale blubber\", \"priority\":2}]}, \"synonyms\":{}}");

