	add("shout", "{\"term\":\"shout\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old norse\"], \"text\":\"From Middle english (1100-1500) {{m|enm|shouten}}. Origin Uncertain. Possibly related to Middle english (1100-1500) {{m|enm|shooten||to shoot (out)}} or from or akin to Old norse {{m|non|skúta||to chide, scold}}, Old norse {{m|non|skúti}}, {{m|non|skúta||a taunt}}. See also the second, rare sense of the verb scout - \u0026quot;to reject with contempt\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A loud burst of voice or voices; a vehement and sudden outcry, especially that of a multitude expressing joy, triumph, exultation, or animated courage\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A round of drinks in a pub; the turn to pay the shot or scot; an act of paying for a round of drinks\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1984\u0027\u0027, w:Keri Keri Hulme, \u0027w:The Bone The Bone People\u0027, your|his|her+shout%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dHLxicLYu1r\u0026amp;sig\u003dGI1Bt6CwKw8isBwImTQJpR-Tkjc\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dWItIUOe3AvG8iAet2ICgCg\u0026amp;redir_esc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"your|his|her%20shout%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 290\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"“I′ll get my wine though,” taking out her wallet\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"“No. This is my \u0027\u0027shout\u0027\u0027,” holding up his hand as though to ward her money off\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, \u0027Knock \u0027Em Out\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Cut to the pub on a lads night out\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Man at the bar cos it was his \u0027\u0027shout\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, George Papaellinas, \u0027The Trip: An Odyssey\u0027, re.press, Australia, your|his|her+shout%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dCbNTLu62lL\u0026amp;sig\u003dVluqJH0iDkhvHfAE-8vm7LjHRJo\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dWItIUOe3AvG8iAet2ICgCg\u0026amp;redir_esc\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"your|his|her%20shout%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 6\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"It was always my \u0027\u0027shout\u0027\u0027 down the pub with Theo\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A call-out for an emergency services team\", \"priority\":13}]}, \"synonyms\":{}}");

	add("shoulder", "{\"term\":\"shoulder\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"West Frisian\", \"middle low german\", \"low german\", \"Dutch\", \"old frisian\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) {{m|enm|sholder}}, {{m|enm|shulder}}, {{m|enm|schulder}}, from Old english (ca. 450-1100) {{m|ang|sculdor}}, {{m|ang|sculdra||shoulder}}, from Proto-germanic {{m|gem-pro|*skuldrô||shoulder}}, of uncertain origin. Perhaps related to Proto-germanic {{m|gem-pro|*skelduz||shield}}, see {{l|en|shield}}. Cognate with Old frisian {{m|ofs|skuldere||shoulder}} (West frisian {{m|fy|skouder||shoulder}}), Middle low german {{m|gml|scholder||shoulder}}, Low german {{m|nds|Schuller||shoulder}}, Dutch {{m|nl|schouder||shoulder}}, German {{m|de|Schulter||shoulder}}, Danish {{m|da|skulder||shoulder}}, Swedish {{m|sv|skuldra||shoulder}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The part of an animal\u0027s body between the base of the neck and forearm socket\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The part of the human torso forming a relatively horizontal surface running away from the neck\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But then I had the flintlock by me for protection. ¶ There were giants in the days when that gun was made; for surely no modern mortal could have held that mass of metal steady to his \u0027\u0027shoulder\u0027\u0027. The linen-press and a chest on the top of it formed, however, a very good gun-carriage; and, thus mounted, aim could be taken out of the window\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"With just the turn of a \u0027\u0027shoulder\u0027\u0027 she indicated the water front, where, at the end of the dock on which they stood, lay the good ship, \u0027Mount Vernon\u0027, river packet, the black smoke already pouring from her stacks. In turn he smiled and also shrugged a \u0027\u0027shoulder\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The joint between the arm and the torso, sometimes including the surrounding muscles, tendons, and ligaments\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A cut of meat comprised of the upper joint of the foreleg and the surrounding muscle\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The portion of a garment where the shoulder is clothed\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Anything forming a shape resembling a human shoulder\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A shelf between two levels\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A part of a road where drivers may stop in an emergency; a hard shoulder\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The portion of a hill or mountain just below the peak\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Sir (1771-1832\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"the north western \u0027\u0027shoulder\u0027\u0027 of the mountai\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The lateral protrusion of a hill or mountain\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The angle of a bastion included between the face and flank\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"An abrupt projection which forms an abutment on an object, or limits motion, etc., such as the projection around a tenon at the end of a piece of timber\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"The flat portion of type that is below the bevelled portion that joins up with the face\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"The portion below the neck\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"The rounded portion of stringed instrument where the neck joins the body\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"The rounded portion of a bottle where the neck meets the body\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"The angled section between the neck and the main body of a cartridge\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"That which supports or sustains; support\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"1564-1616\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"In thy \u0027\u0027shoulder\u0027\u0027 do I build my seat\", \"priority\":24}]}, \"synonyms\":{}}");

