	add("shovel", "{\"term\":\"shovel\", \"etymology\":{\"influencers\":[{},{},{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"West Frisian\", \"Icelandic\", \"low german\", \"Dutch\", \"scots\", \"saterfriesisch\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027shovele\u0027 \u0027schovel\u0027 \u0027showell\u0027 \u0027shoule\u0027 \u0027shole\u0027 (\u0026gt; English dialectal \u0027shoul\u0027 \u0027shool\u0027 , from Old english (ca. 450-1100) \u0027scofl\u0027 (shovel) from Proto-germanic {{m|gem-pro|*skuflō}}, {{m|gem-pro|*skūflō||shovel}}, equivalent to {{suffix|shove|el|pos2\u003dinstrumental/agent suffix|lang\u003den}}. Cognate with Scots \u0027shuffle\u0027 \u0027shule\u0027 \u0027shuil\u0027 (shovel) Saterfriesisch \u0027sköifel\u0027 (shovel) West frisian \u0027skoffel\u0027 \u0027schoffel\u0027 (hoe, spade, shovel) Dutch \u0027schoffel\u0027 (spade, hoe) Low german \u0027schüfel\u0027 \u0027schuffel\u0027 (shovel) German \u0027schaufel\u0027 (shovel) Danish \u0027skovl\u0027 (shovel) Swedish \u0027skyffel\u0027 \u0027skovel\u0027 (shovel) Icelandic \u0027skófla\u0027 (shovel)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hand tool with a handle, used for moving portions of material such as earth, snow, and grain from one place to another, with some forms also used for digging. Not to be confused with a spade, which is designed solely for small-scale digging and incidental tasks such as chopping of small roots\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A spade\", \"priority\":2}]}, \"synonyms\":{}}");

